    imgSrc={Sdata[3].imgSrc}
    title={Sdata[3].title}
    link={Sdata[3].link}
    sName={Sdata[3].sName}
/>
<Card
    imgSrc={Sdata[4].imgSrc}
    title={Sdata[4].title}
    link={Sdata[4].link}
    sName={Sdata[4].sName}
/>
<Card
    imgSrc={Sdata[5].imgSrc}
    title={Sdata[5].title}
    link={Sdata[5].link}
    sName={Sdata[5].sName}
/>


</>, document.getElementById("root"));
